import {useNavigate} from "react-router-dom"
import React, { useState} from "react";
export type UserType = {

	Email: string;
	Password: string

}
type UsersType = Array<UserType>

const Login = () => {
	const navigate = useNavigate()
	const [Email,setEmail]=useState("");
	const [Password,setPassword]=useState("");
	//const dispatch= useDispatch()
	//ADMIN
	//USER

	const Loginhandle = () => {
		const [Email, setEmail] = React.useState<UsersType>([])
		localStorage.setEmail("Email", JSON.stringify({role: "ADMIN"}))
		navigate("/dashboard")
		//console.table(Email,Password)
    //dispatch(signInUser({Email,Password}))
	}
	React.useEffect(() => {
		//fetch users from json placeholder
		fetch("https://symmi-be.symcloud.net/owner/login")
			.then((response) => response.json())
			.then((json) => setEmail(json))
	}, [])

	return (

		<div className="full-page">

                    <div className="form-box"  >
                        <div className="form" >
                        <div  className="login-box">
                        <img src= "/pics/logo.png" alt="2.png" className="formlogo"></img>

                </div>
                            <div  className="login-box">

                </div>
                       <h1 className="main-heading">SIGN-IN </h1>
                        <h2 className="head">Welcome to Mobile Repair System</h2>
                                <p>Email/username</p>                               
				                <input  type="text" placeholder="username" value={Email} onChange={(e)=>setEmail(e.target.value)}/>
                                <p>Password</p>
				                <input type="password" placeholder="Password" value={Password} onChange={(e)=>setPassword(e.target.value)} /><br></br>
				                <button type="submit" onClick={Loginhandle}>Sign In</button>
                                <p className="message">Dont have an account? contact portal administor</p></div>
				            </div>
                            </div>
	)
}

export default Login
